@styromaniac@zeroid.bit: Unfortunately, I cannot help you. I looked through diff between ZeroMe and ZeroMe Mobile `all.js`, but didn't find any critical changes. There are lines

```javascript
      if (e.target.type && (e.target.type === "everyone" || e.target.type === "lang" || e.target.type.slice(0, 3) === "hub")) {
        this.hide();
      } else if (e.target.value || e.target.title === "") {
        this.show();
      } else if (keep_menu !== true) {
        this.hide();
      }
```

which can hide posts, but that function is called on clicking `everyone` and other tabs, so I am not sure if this means anything.

